import React from 'react'
import products from '../products'
import { Container, Row, Col } from 'react-bootstrap'

const Homescreen = () => {
    return (
        <>
            <h1>Latest Products</h1>
            {products.map(products => (
                <Row>
                    <Col sm={12} md={6} lg={4}>
                        <h3>{products.name}</h3>
                    </Col>
                </Row>
            )

            )}
        </>
    )
}



export default Homescreen;
